import { BrowserRouter, Route } from "react-router-dom";


function App() {
  return (
    <div className="App">

      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Header />}>

            <Route index element={ <Home />}></Route>
            <Route path='postId' element={<Post />}></Route>
          </Route>



       </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
